import { Component } from '@angular/core';

@Component({
  selector: 'app-policy-list',
  template: `
    <div class="policy-container">
      <h1>Policy Management</h1>
      <p>Policy list and management will be implemented here</p>
    </div>
  `,
  styles: [`
    .policy-container {
      padding: 24px;
    }
  `]
})
export class PolicyListComponent { }
